HQ very rare promo music video. &quot;It's Over&quot; is a song recorded by the Electric Light Orchestra.

&quot;It's Over&quot; is the second track from the LP Out of the Blue. It was the last single to be lifted from the album and was released in the United States only, becoming a minor hit. The orchestral beginning was actually the end of &quot;Mr. Blue Sky&quot; reversed.

Out of the Blue is the seventh studio album by the British rock group Electric Light Orchestra, released in October 1977. Written and produced by ELO frontman Jeff Lynne, the double album is among the most commercially successful records in the group's history.

Jeff Lynne wrote the entire album in three and a half weeks after a sudden burst of creativity while hidden away in his rented chalet in the Swiss Alps. It took a further two months to record in Munich. The album had 4,000,000 pre-ordered copies and quickly went multi-Platinum upon release. Out of the Blue spawned five hit singles in different countries, and was ELO's most commercially successful studio album. It was also the first double album in the history of the UK music charts to generate four top twenty hit singles.

Electric Light Orchestra (ELO) were a British rock group from Birmingham, who released eleven studio albums between 1971 and 1986 and another album in 2001. ELO were formed to accommodate Roy Wood and Jeff Lynne's desire to create modern rock and pop songs with classical overtones. After Wood's departure following the band's debut record, Lynne wrote and arranged all of the group's original compositions and produced every album.
